import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { AppComponent } from './app.component'; // Certifique-se de importar corretamente o componente

const routes: Routes = [
  { path: '', component: AppComponent }, // Rota raiz
  // Defina outras rotas aqui conforme necessário
  { path: '**', redirectTo: '', pathMatch: 'full' } // Rota coringa para redirecionar rotas não encontradas
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
